import React from "react";

function Card() {
    return(
        <>
            <div className="card">
                <img src="https://m.media-amazon.com/images/I/91G5xnoFOqL._AC_SY606_.jpg" alt="Poster Pic" className="image" />
                <div className="cardContent">
                    <p className="topText">A Netflix original series</p>
                    <h3 className="title">DARK</h3>
                    <a href="www.netflix.com" className="link">
                        <button>Watch Now</button>
                    </a>
                </div>
            </div>
        </>

    );

}

export default Card;
